import React from "react";
import Modal from "../../../Components/Modal/Modal";

export default function ({isOpen, onClose}) {
    const closeModal = () => {
        onClose();
    };
    return (
        <Modal isOpen={isOpen} onClose={closeModal}>
            <h2>Change Name</h2>
        </Modal>
    )
}
